"Google Снимки използва местоположението, за да ви помага да организирате и намирате снимките си.

 Данните за местоположението може да се получават от информация като:
 • позицията на камерата ви според GPS;
 • записите ви в Google История на местоположенията;
 • открити забележителности."

"Припомнете си преживяванията от местата, където сте били, като разглеждате снимките си с информация за местоположението, включително запазени от вас споделени снимки. Картата използва данни за местоположението, като например:

 • позицията на камерата ви според GPS;
 • записите ви в Google История на местоположенията;
 • открити забележителности."

"Google Снимки ще изтрие за постоянно следните данни от приложението: 

• снимките и видеоклиповете в заключената папка; 
• информацията за профилите, в които сте влезли; 
• настройките. 

Снимките и видеоклиповете извън заключената папка и другите данни от приложението няма да бъдат изтрити."
